import { Link } from 'react-router-dom'
import { Col, Container, Row } from 'react-bootstrap';
import './Footer.css'

export default function Footer() {
    return (
        <Container className="Footer">
            <Row>
                <Col></Col>
            </Row>
            <hr />
        </Container>
    )
}
